car_1:
CREATE TABLE continents (
    ContId NUMERIC PRIMARY KEY,
    Continent TEXT
);

CREATE TABLE countries (
    CountryId NUMERIC PRIMARY KEY,
    CountryName TEXT,
    Continent NUMERIC,
    FOREIGN KEY (Continent) REFERENCES continents(ContId)
);

CREATE TABLE car_makers (
    Id NUMERIC PRIMARY KEY,
    Maker TEXT,
    FullName TEXT,
    Country TEXT,
    FOREIGN KEY (Country) REFERENCES countries(CountryId)
);

CREATE TABLE model_list (
    ModelId NUMERIC PRIMARY KEY,
    Maker NUMERIC,
    Model TEXT,
    FOREIGN KEY (Maker) REFERENCES car_makers(Id)
);

CREATE TABLE car_names (
    MakeId NUMERIC PRIMARY KEY,
    Model TEXT,
    Make TEXT,
    FOREIGN KEY (Model) REFERENCES model_list(Model)
);

CREATE TABLE cars_data (
    Id NUMERIC PRIMARY KEY,
    MPG TEXT,
    Cylinders NUMERIC,
    Edispl NUMERIC,
    Horsepower TEXT,
    Weight NUMERIC,
    Accelerate NUMERIC,
    Year NUMERIC,
    FOREIGN KEY (Id) REFERENCES car_names(MakeId)
);

course_teach:
CREATE TABLE course (
    Course_ID NUMERIC PRIMARY KEY,
    Staring_Date TEXT,
    Course TEXT
);

CREATE TABLE teacher (
    Teacher_ID NUMERIC PRIMARY KEY,
    Name TEXT,
    Age TEXT,
    Hometown TEXT
);

CREATE TABLE course_arrange (
    Course_ID NUMERIC PRIMARY KEY,
    Teacher_ID NUMERIC,
    Grade NUMERIC,
    FOREIGN KEY (Teacher_ID) REFERENCES teacher(Teacher_ID),
    FOREIGN KEY (Course_ID) REFERENCES course(Course_ID)
);

museum_visit:
CREATE TABLE museum (
    Museum_ID NUMERIC PRIMARY KEY,
    Name TEXT,
    Num_of_Staff NUMERIC,
    Open_Year TEXT
);

CREATE TABLE visitor (
    ID NUMERIC PRIMARY KEY,
    Name TEXT,
    Level_of_membership NUMERIC,
    Age NUMERIC
);

CREATE TABLE visit (
    Museum_ID NUMERIC PRIMARY KEY,
    visitor_ID TEXT,
    Num_of_Ticket NUMERIC,
    Total_spent NUMERIC,
    FOREIGN KEY (visitor_ID) REFERENCES visitor(ID),
    FOREIGN KEY (Museum_ID) REFERENCES museum(Museum_ID)
);

