CREATE TABLE AREA_CODE_STATE (
    area_code NUMERIC PRIMARY KEY,
    state TEXT
);

CREATE TABLE CONTESTANTS (
    contestant_number NUMERIC PRIMARY KEY,
    contestant_name TEXT
);

CREATE TABLE VOTES (
    vote_id NUMERIC PRIMARY KEY,
    phone_number NUMERIC,
    state TEXT,
    contestant_number NUMERIC,
    created DATETIME,
    FOREIGN KEY (contestant_number) REFERENCES CONTESTANTS(contestant_number),
    FOREIGN KEY (state) REFERENCES AREA_CODE_STATE(state)
);

